sources.styles\\blocks\\page.scss:
.page {
  font-family: "Cinzel", serif;
  scroll-behavior: smooth;

  &__body {
    margin: 0;

    &--with-menu {
      overflow: hidden;
    }
  }

  &__header {
    margin-bottom: 100px;

    @include onTablet {
      margin-bottom: 140px;
    }
  }

  &__menu {
    position: fixed;
    top: 0;
    left: 0;
    right: 0;
    transform: translateX(-100%);
    transition: transform 0.5s;

    &:target {
      transform: translateX(0);
    }
  }

  &__section {
    margin-bottom: 100px;

    @include onTablet {
      margin-bottom: 140px;
    }
  }

  &__section-title {
    margin: 0 0 8px;
    font-weight: bold;
    font-size: 32px;
    line-height: 32px;
    letter-spacing: -1.5px;
    color: $colorText;
    text-align: center;

    @include onTablet {
      font-size: 48px;
      line-height: 48px;
    }
  }

  &__gallery {
    margin-bottom: 48px;

    &--last {
      margin-bottom: 40px;
    }
  }
}

