sources.styles\\blocks\\icon.scss:
.icon {
  display: block;
  width: 18px;
  height: 18px;
  background-position: center;
  background-size: contain;
  background-repeat: no-repeat;
  position: relative;

  &__tooltip {
    position: absolute;
    transform: translate(-100%, 5%);
    width: max-content;
    padding-right: 20px;
    text-align: right;
    opacity: 0;
    pointer-events: none;
    transition: opacity 0.5s;
  }

  &:hover + &__tooltip {
    opacity: 1;
    pointer-events: all;
  }

  @include onTablet {
    width: 24px;
    height: 24px;
  }

  &--menu {
    background-image: url(../images/Menu.svg);

    &:hover {
      background-image: url(../images/menu_hover.svg);
    }
  }

  &--phone {
    background-image: url(../images/Phone.svg);
  }

  &--closeUp {
    background-image: url(../images/closeup.svg);
  }
}

