sources.styles\\blocks\\gallery.scss:
.gallery {
  &__photos {
    margin-bottom: 24px;
  }

  &__photo-container {
    position: relative;
    width: 100%;
    max-height: 320px;
    box-sizing: border-box;
    overflow: hidden;
    transition: transform 0.5s;

    &:hover {
      transform: scale(1.1);
    }

    &::after {
      content: "";
      display: block;
      padding-bottom: 100%;
    }

    @include onTablet {
      height: 320px;
      padding-bottom: 0;
    }
  }

  &__photo {
    position: absolute;
    width: 100%;
    height: 100%;
    object-fit: cover;
    object-position: center;
  }

  &__link {
    font-weight: bold;
    font-size: 16px;
    line-height: 27px;
    color: $colorAccentRed;
    text-decoration: none;
  }

  &__text {
    margin: 0;
    font-size: 16px;
    line-height: 27px;
    color: $colorText;
  }
}

